import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import { fetchData } from '../services/api';

const TestDetails = () => {
  const { id } = useParams();  // Obtenemos el ID del test desde la URL
  const [test, setTest] = useState(null);

  useEffect(() => {
    // Obtenemos los datos del test desde el archivo JSON usando fetchData
    fetchData().then(data => {
      if (data.test && data.test.tid === id) {
        setTest(data.test);
      }
    });
  }, [id]);

  if (!test) {
    return <p>Loading...</p>;
  }

  // Función para manejar los campos inexistentes
  const getFieldValue = (field) => field !== undefined && field !== null ? field : 'No existeix';

  return (
    <div>
      <h1>Test Details for Test ID: {test.tid}</h1>

      <h2>General Test Data</h2>
      <p><strong>O2 Prescribed:</strong> {getFieldValue(test.o2)}</p>
      <p><strong>Patient ID:</strong> {getFieldValue(test.pid)}</p>
      <p><strong>Doctor ID:</strong> {getFieldValue(test.did)}</p>
      <p><strong>Pulsioxímetre ID:</strong> {getFieldValue(test.pulsid)}</p>

      <h2>Initial Basals</h2>
      <p><strong>Saturation (spo):</strong> {getFieldValue(test.initial?.spo)}</p>
      <p><strong>Heart Rate (hr):</strong> {getFieldValue(test.initial?.hr)}</p>
      <p><strong>Dispnea (d):</strong> {getFieldValue(test.initial?.d)}</p>
      <p><strong>Fatiga (f):</strong> {getFieldValue(test.initial?.f)}</p>

      <h2>Final Values</h2>
      <p><strong>Meters Walked:</strong> {getFieldValue(test.final?.meters)} mts</p>
      <p><strong>Dispnea (d):</strong> {getFieldValue(test.final?.d)}</p>
      <p><strong>Fatiga (f):</strong> {getFieldValue(test.final?.f)}</p>
      <p><strong>Final Rest SPO2:</strong> {getFieldValue(test.final?.end_rest_spo)}</p>
      <p><strong>Final Rest HR:</strong> {getFieldValue(test.final?.end_rest_hr)}</p>
      <p><strong>Comments:</strong> {getFieldValue(test.final?.comment)}</p>

      <h2>Passes to the Cone</h2>
      <ul>
        {test.pascon?.length > 0 ? (
          test.pascon.map((pass, index) => (
            <li key={index}>
              Pass {getFieldValue(pass.n)} at {getFieldValue(pass.t)} seconds: SPO2 = {getFieldValue(pass.s)}, HR = {getFieldValue(pass.h)}
            </li>
          ))
        ) : (
          <li>No existeix</li>
        )}
      </ul>

      <h2>Stops</h2>
      <ul>
        {test.stops?.length > 0 ? (
          test.stops.map((stop, index) => (
            <li key={index}>
              Stop at {getFieldValue(stop.time)} seconds, duration: {getFieldValue(stop.len)} seconds
            </li>
          ))
        ) : (
          <li>No existeix</li>
        )}
      </ul>
    </div>
  );
};

export default TestDetails;
